import React, { Component } from 'react';
import '../static/css/addMaterias.css';

class AddTopicos extends Component {

    handleSubmit = e => {
        e.preventDefault();
        console.log('Submited');
    }


    render() { 
        return ( 
            <div className = "addTopicos">
                <h2>Tela de adição de tópicos</h2>
                <form className = "addForm" onSubmit ={this.handleSubmit}>
                    <div className="addItem">
                        <label for="materia">Materia</label>
                        <input autoFocus className = "addInput" type="text" id="materia" name="materia"/>
                    </div>
                    <div className="addItem">
                        <label for="assunto">Assunto</label>
                        <input autoFocus className = "addInput"  type="text" id="assunto" name="assunto"/>
                    </div>
                    <div className="addItem">
                        <label for="topico">Tópico</label>
                        <input className = "addInput"  type="text" id="topico" name="topico"/>
                    </div>
                    <div className="addItem">
                        <label for="preReq">Pré-Requisitos</label>
                        <input autoFocus className = "addInput"  type="text" id="preReq" name="preReq"/>
                    </div>
                    <div className="addItem">
                        <input className = "submitBtn" type="submit" value="Salvar"/>
                    </div>
                </form>
            </div>
         );
    }
}

export default AddTopicos;
